//  RTC5close
//
//  This function terminates the explicit linking to the RTC5DLL.DLL or libslrtc5.so.
//  Call it when the use of the RTC5 functions is finished.
void RTC5close(void) {
    if (gLibRTC5) {
#ifdef _WIN32
        (void)FreeLibrary(gLibRTC5);
#else
        (void)dlclose(gLibRTC5);
#endif
    }
    if (gLibRTC5) {
        gLibRTC5 = NULL;
    }
}
